from kmp import kmp


def test_kmp():
    print()
    assert kmp("ababcabcabababd", "ababd") == [(10, 14)]
    assert kmp("Some real text to show reliability of algo", "re") == [(5, 6), (23, 24)]
    assert kmp("Some real text to show reliability of algo", "axios") == -1
    assert kmp("",
              "ababababababababababababfd") == [(3196, 3221)]


def test_exec_time():
    print()
    kmp("",
        "aaaaaaaaaaaaaaaaaaaaaaa")
    kmp("",
        "abababababababababdf")
    kmp("",
        "acaacaacaacadf")
